import React from 'react';
import './style.scss';
import ProfileImage from '../../assets/image/vegetable.svg';
export function Profile(){
    return(
        <div className="conatainer">
            <h1>User Profile</h1>
            <Image src={ProfileImage} className="image" alt="Logo"/>
        </div>
    )
}
